import io
import sys

# input here
_INPUT = """\
60522 26641


"""
sys.stdin = io.StringIO(_INPUT)



N, K = map(int, input().split())
S = input()

pre = S[0]
dir = 0
l = []
for s in S[1:]:
    if s != pre:
        l.append(dir)
        dir = 1 - dir
    pre = s
l.append(dir)

if K >= len(l) // 2:
    print(N - 1)
else:
    for i in range(1, 1 + 2 * K, 2):
        l[i] = 0

    pre = 0
    dir = 0
    ll = []
    for a in l[1:]:
        if a != pre:
            ll.append(dir)
            dir = 1 - dir
        pre = a
    ll.append(dir)

    print(N - len(ll))
